import React from "react";
import axios from "axios";
import Nav from "./navVendedor";
import './styles/detalleProducto.css';

export class DashVendedor extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      producto: [],
    };
  }

  async componentDidMount() {
    const producto = await axios.get(`http://localhost:5000/producto/search/${this.props.match.params.id}`);
    this.setState({ producto: producto.data });
  }

  render() {
    return (
    <>
      <Nav/>
      <div className="container-producto">
          <div className="card-signle">
              <div>
